import React from 'react';
import { Link } from 'react-router-dom';

function ContactContent(props) {
  return (
    <>
      <li className='contactcontent__item'>
        <Link className='contact__content__link' to={props.path}>
          <figure className='contact__content__pic-wrap' data-category={props.label}>
            <img
              className='contact__content__img'
              alt='Travel Image'
              src={props.src}
            />
          </figure>
          <div className='contact__content__info'>
            <h5 className='contact__content__text'>{props.text}</h5>
          </div>
        </Link>
      </li>
    </>
  );
}

export default ContactContent;
